import LeatherArmorImg from './leather-armor.png';

const LeatherArmor = {
    name: 'Leather Armor',
    type: 'armor::body',
    effect: {
        defence: 5,
    },
    image: LeatherArmorImg,
    value: 40,
};

export default LeatherArmor;
